original_question:
Waa maxay masaafada ugu gaaban ee la mari karo haddii aad ka bilowdo meel kasta, $A$, $B$, $C$, ama $D$, oo aad booqato saddexda kale hal mar?

[asy]
pair A,B,C, D;
A = (-3,3); B = (3,0); C = (0, -4); D = (0,0);
draw(D--B--C--cycle); draw(D--A--B--cycle);draw(D--A--C--cycle);
label("$A$", A, NW);label("$B$", B, E); label("$C$", C, S);label("$D$", D, NE);
